import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import UserInfo from './components/UserInfo';
import CompletionStatus from './components/CompletionStatus';
import WeeklyReport from './components/WeeklyReport';
import TriggerAnalysis from './components/TriggerAnalysis';
import BingeEatingAnalysis from './components/BingeEatingAnalysis';
import PositiveMealAnalysis from './components/PositiveMealAnalysis';
import Settings from './components/Settings'; 
import SettingsProfile from './components/SettingsProfile';
import SettingsPassword from './components/SettingsPassword';
import Login from './components/Login';
import Join from './components/Join';
import JoinGeneral from './components/JoinGeneral';
import './App.css';

function App() {

  const startDate = '7.22';
  const endDate = '7.28';

  //모바일 실제 화면 크기에 맞추기
  // function setScreenSize() {
  //   let vh = window.innerHeight * 0.01;
  //   document.documentElement.style.setProperty("--vh", `${vh}px`);
  // }
  // useEffect(() => {
  //   setScreenSize();
  // });

  return (
    <Router>
      <div className='App'>
        <Routes>
          <Route path='/' element={
            <>
              <UserInfo name='김예원' daysManaged={72} />
              <CompletionStatus mealManagement={6} complimentDone={6} />
              <WeeklyReport startDate={startDate} endDate={endDate} />
              <TriggerAnalysis />
              <BingeEatingAnalysis />
              <PositiveMealAnalysis />
            </>
          } />
          <Route path='/settings' element={<Settings />} />
          <Route path='/settings/profile' element={<SettingsProfile />} />
          <Route path='/settings/password' element={<SettingsPassword />} />
          <Route path="/login" element={<Login />} />
          <Route path="/join2" element={<Join />} />
          <Route path="/join" element={<JoinGeneral />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
